import React from 'react';

function TrafficPage() {
    const now = new Date().toLocaleString();

    return (
        <div className="traffic-page" style={{ padding: '20px', textAlign: 'center' }}>
            <h1>교통 정보 페이지 테스트</h1>
            <p>현재 시각: {now}</p>
            <p style={{ color: 'gray' }}>이 페이지는 라우팅 테스트용입니다.</p>
        </div>
    );
}

export default TrafficPage;
